import base64
from purplship.core.units import Package
from purplship.core.models import ShipmentRequest, LabelTemplate


def generate_label(
    request: ShipmentRequest,
    package: Package,
    label_template: LabelTemplate = None,
) -> str:
    label_type = request.label_type or "PDF"

    return PDF_LABEL_PLACEHOLDER if label_type == "PDF" else ZPL_LABEL_PLACEHOLDER


ZPL_LABEL_PLACEHOLDER = ""


PDF_LABEL_PLACEHOLDER = ""
